import React, { useState, useEffect } from "react";
import { Col, Row } from "shards-react";
import { Link } from "react-router-dom";

export default function Landing() {
  const [companies, setCompanies] = useState([]);

  return (
    <Col className="d-flex justify-content-center pt-5">
      <Row noGutters className="page-header py-4 px-4 bg-white card" style={{ width: "fit-content", minWidth: "100"}}>
        <h2 className="mb-4" style={{ width: "100%" }}>
          Welcome!
        </h2>
        <h4 className="mb-4 text-left">Select Company:</h4>
        <Row>
          <Col style={{width: "200px", height: "200px"}}>
            <Link to="/interface">
              <Col className="d-flex flex-column justify-content-center col-lg 6 col-md-6 col-sm-12">
                <p
                  style={{
                    textAlign: "center",
                    fontWeight: "500",
                    fontSize: "1.2rem",
                    color: "#3d5170",
                  }}
                  className="my-2 card-header"
                >
                  Company 1
                </p>
              </Col>
            </Link>
          </Col>

        </Row>
      </Row>
    </Col>
  );
}
